import React,{Component} from 'react';
import { Link } from 'react-router-dom';

class AssetEditor extends Component{
  constructor(props){
      super(props)
      this.state = {
        nid: 0,
      }
    }
    render(){
      return(
        <div className="container">
          <div className="row">
            <div className="col-lg">
              Equipo Nid: {this.state.nid}
            </div>
          </div>

          <div className="row" style={{marginTop:'50px'}}>
            <div className="col-lg" style={{textAlign:'center'}}>
              <Link to="/qr"><button type="button" className="btn btn-outline-primary btn-lg">Regresar</button></Link>
            </div>
          </div>
        </div>
      )
    }
}

export default AssetEditor;
